Quem procuramos?
• Mais de 5 anos de experiência como programador Android.
• Experiência comprovada com Kotlin.
• Experiência com o Android SDK, Android UI, Eclipse ou Android Studio.
• Experiência em C++ e familiaridade com outras linguagens de programação de baixo nível, essenciais para o desenvolvimento a nível do sistema.
• Proficiência em inglês (obrigatório).

O que nos torna diferentes?
• A nossa cultura organizacional baseia-se em valores tais como transparência, espírito de equipa, feedback regular e aprendizagem contínua;
• Prémios de referência e presente de aniversário;
• Zonas de lounge;
• Não temos um código de vestuário;
• Chamamo-lo pelo seu nome e todos nos dirigimos informalmente uns aos outros;
• Café e petiscos à sua disposição;
• Vai crescer em boa companhia. Não é essa a melhor forma de melhorar profissionalmente?

O BiG é um Banco nacional especialista em Poupança e Investimento, com presença em Portugal, Espanha e Moçambique.

Imagina-te a fazer o que sempre gostaste e a ter uma carreira na área da Banca de Investimento… Imagina-te no BiG !

Pretendemos recrutar, um(a) candidato(a) para integrar a equipa de Informática do BiG.

Responsabilidades:
• Desenhar e implementar aplicações complexas para as plataformas Android e iOS;
• Propor e implementar testes automáticos (unit, funcional, coded-ui/ end-to-end);
• Propor e implementar evoluções nas aplicações existentes;
• Contribuir na Gestão e manutenção das aplicações.
